import React, { useState, useEffect } from "react";
import { connect } from "react-redux";

import { getDatabaseList } from "./Redux/actions"
import { useAuth0 } from "../../App/react-auth0-spa";

interface DatabaseProps {
    dispatchDatabaseList: any;
}

function Database(props: DatabaseProps): React.ReactElement {
    const [databaseList, setList] = useState();
    const { getTokenSilently } = useAuth0();
    const [token, setToken] = useState();
    const [refreshRequired, setRefreshRequired] = useState(true);

    useEffect(() => {
        const fetchDatabaseList = async () => {
            if (refreshRequired) {
                const newToken = await getTokenSilently();
                setToken(newToken);
                props.dispatchDatabaseList(newToken)
                setRefreshRequired(false);
            }
        };
        fetchDatabaseList();
    }, [refreshRequired]);

    const generateList = () => {
        databaseList.map((table: string) => {
            return (
                <div
                // onClick={getTable}
                >{table}</div>
            )
        })
    }

    return (
        <div>

        </div>
    )
}

const mapStateToProps = (state: any) => {
    return {
        databaseList: state.databaseList
    }
}

const mapDispatchToProps = (dispatch: any) => {
    return {
        dispatchDatabaseList: (token: string) => dispatch(getDatabaseList(token))
    }
}

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(Database);
